import React from 'react';

function Footer () {
    return(
        <div class="footer" id="footer">
            <a href="https://github.com/riazk88"><img src="https://img.icons8.com/nolan/64/github.png" alt="Github" class="icon"/></a>
            <a href="https://www.linkedin.com/in/kiran-riaz/"><img src="https://img.icons8.com/nolan/64/linkedin.png" alt="Linkedin" class="icon"/></a>
            <a href=""><img src="https://img.icons8.com/nolan/64/github.png" alt="Twitter" class="icon"/></a>
        </div>
    )
}

export default Footer;
